import React from 'react';
import styles from './FieldSet.module.scss';
import { Col, Row } from 'react-bootstrap';
const FieldSet = () =>{
    return(
        <Row>
        <div className={styles['field-set']}>
            <fieldset>
                <legend>Title</legend>
                <input/>
            </fieldset>
        </div>
        </Row>
    )
}

export default FieldSet;
